@lizanializa Olá Liziana! A exposição
"Pará sentir fé" ficará em exibição até sexta-feira (30/09), enquanto a exposição
"Artesania Ancestral nos 95 anos de Mangueira" permanecerá por um período de 10 meses. Espero que você aproveite a oportunidade de visitá-las! 😉

